public void enableFieldsActive()
{
    // empty - required for the form control class
}

public void init()
{
    ReqParameters::checkPlanningProcessesAreEnabled();

    reqTransForm = ReqTransFormPO::newFormRun(element);

    super();

    reqTransForm.parmUseCheckmarks(true);

    reqTransForm.formInitPost();

    element.initDesign();
}

public void initDesign()
{
    switch (reqTransForm.parmReqRefType())
    {
        case ReqRefType::ItemPlannedOrder:
            element.design().caption("@SYS5151");
            headerTitle.text("@SYS5151");
            break;

        case ReqRefType::PmfPlannedProdBatch:
        case ReqRefType::BOMPlannedOrder:
            element.design().caption("@SYS12742");
            headerTitle.text("@SYS12742");
            break;

        case ReqRefType::TransferPlannedOrder:
            element.design().caption("@SYS58078");
            headerTitle.text("@SYS58078");
            break;
    }
}

public Object inventDimSetupObject()
{
    return reqTransForm.inventDimSetupObject();
}

/// <summary>
/// Set status of Catch weight and corresponding standard fields
/// </summary>
public void pdsCWEnableFields()
{
    boolean pdsCWAllowEdit;

    pdsCWAllowEdit = PdsGlobal::pdsIsCWItem(reqPo.ItemId);

    reqPo_ds.object(fieldNum(ReqPO, PdsCWReqQty)).allowEdit(pdsCWAllowEdit);
    reqPo_ds.object(fieldNum(ReqPO, Qty)).allowEdit(!pdsCWAllowEdit);
    reqPo_ds.object(fieldNum(ReqPO, PurchQty)).allowEdit(!pdsCWAllowEdit);
}

public void refreshCaller()
{
    FormDataSource  formDS;

    if (element.args().caller().name() == formStr(PMFSeqReqRouteChangesListPage))
    {
        formDS = FormDataUtil::getFormDataSource(element.args().record());
        formDS.research();
    }
}

