/// <summary>
/// Returns the value of the PmfPriority field
/// </summary>
/// <param name="_reqTrans">
/// ReqTrans record
/// </param>
/// <returns>
/// Returns current value of PmfPriority field
/// </returns>
public display PmfPlanPriorityCurrent pmfPriority(
    ReqTrans                _reqTrans)
{
    if (hasFieldAccess(tableNum(ReqTrans),
                        fieldNum(ReqTrans,PmfPlanPriorityCurrent),
                        AccessType::View)
        && hasFieldAccess(tableNum(ReqItemTable),
                        fieldNum(ReqItemTable,PmfPlanPriorityCurrent),
                        AccessType::View))
    {
        return _reqTrans.PmfPlanPriorityCurrent;
    }

    return 0;
}

